(2, 1, 'Gates are open!', 'Welcome to the event', '2013-03-07 20:42:40', 0, 0),
(3, 4, 'BlackBerry Presents Alicia Keys - Los Angeles tick', 'Dear Guest,\nWe look forward to seeing you at the show tonight at Staples Center.\nYou can collect your tickets from the BlackBerry VIP Will Call located at \n\nWindow 3\nMain Box Office\nChick Hearn Court\nStaples Center\n1111 S Figueroa Ave\nLos Angeles, CA\n90015\n\nDoors Open 6:30pm\nMiguel 7:30pm\nAlicia Keys 8:45pm\nWill Call closes 9.15pm\n\nSee you at the show!\n', '2013-03-12 13:59:23', 0, 0),
(4, 5, 'Blackberry Presents Alicia Keys', 'Dear Guest,\nWe look forward to seeing you at the show tonight at Valley View Casino Center.\nYou can collect your tickets from the BlackBerry VIP Will Call located at \n\nBlackBerry Will Call window \nMain Box Office  North side of venue\nValley View Casino Center\n3500 Sports Arena Blvd.\nSan Diego, CA 92110\n619-224-4171\n\nDoors Open 6:30pm\nMiguel 7:30pm\nAlicia Keys 8:45pm\nWill Call closes 9.15pm\n\nSee you at the show!\n', '2013-03-13 15:46:22', 0, 0);
